import React from 'react';

const variants = [
    {
        key: 'home',
        value: {
            d: "M7.5 7.5h-.75A2.25 2.25 0 004.5 9.75v7.5a2.25 2.25 0 002.25 2.25h7.5a2.25 2.25 0 002.25-2.25v-7.5a2.25 2.25 0 00-2.25-2.25h-.75m0-3l-3-3m0 0l-3 3m3-3v11.25m6-2.25h.75a2.25 2.25 0 012.25 2.25v7.5a2.25 2.25 0 01-2.25 2.25h-7.5a2.25 2.25 0 01-2.25-2.25v-.75",
        }
    },
    {

    }
];

const Icon = ({ name="", viewBox = "0 0 24 24", ...props }) => {

    const current = variants.find(variant => variant.key === name);

    if (!current) {
        console.error(`Variant not found for name: ${name}`);
        return (
            <div className='bg-rose-700' {...props}> 
              <p>Name of Icon not found</p>
            </div>
        );
    }

    return (
        <>
            <svg xmlns="http://www.w3.org/2000/svg" viewBox={viewBox} {...props}>
                 <path d={current.value.d} />
            </svg>
        </>
    );
}

export default Icon;
